import React from "react";

function conctactCard(props)
{
    return(
        <div className="contact-card">
         <img src= {props.imgUrl}/>
         <h3>{props.name}</h3>
         <p>{props.phno}</p>
         <p>{props.email}</p>
        </div>
    )
}



export default conctactCard
